svg.script:
	var myMapApp = new mapApp(false,undefined);//与tooltip相关
	var obc;//
	
	window.onSVGLoad=initLater();
	function initLater() {
     	//this timeout is because of the bbox bug in Firefox which prevents to have access to bbox in onload scripts
     	window.setTimeout("init()",1000);
		window.setTimeout("init()",5000);
    }
	function init() {
		
	    /* 添加tooltip*/
        //tooltip styles
        var tooltipTextStyles = {"font-family":"Arial,Helvetica","fill":"dimgray","font-size":800};
        var tooltipRectStyles = {"fill":"white","stroke":"dimgray"};
        myMapApp.initTooltips("toolTip",tooltipTextStyles,tooltipRectStyles,10,20,3);
        //add tooltip to element
		myMapApp.addTooltip("zt",undefined,true,false,"target","name");
		
	}
	
	
	function Newlegend1(){
	 document.getElementById('legend1').setAttribute("style", "visibility: visible");
	 document.getElementById('legend11').setAttribute("style", "visibility: visible");
	 document.getElementById('legend2').setAttribute("style", "visibility: hidden");
	 document.getElementById('legend22').setAttribute("style", "visibility: hidden");
	}
	function Newlegend2(){
	document.getElementById('legend2').setAttribute("style", "visibility: visible");
	 document.getElementById('legend22').setAttribute("style", "visibility: visible");
	 document.getElementById('legend1').setAttribute("style", "visibility: hidden");
	 document.getElementById('legend11').setAttribute("style", "visibility: hidden");
	}
	function Changecolor(evt)
	{
	document.getElementById('Legend2').setAttribute("class", "str0");
	document.getElementById('Legend1').setAttribute("class", "str0");
	var obj = evt.target;           
    obj.setAttribute("class", "str1"); 
	}
	function Recovercolor(evt){
	var obj = evt.target;           
    obj.setAttribute("class", "str0");
	}
